            func_obj->func_version = ((PyCodeObject *)detag(codeobj))->co_version;
            func = (PyObject *)func_obj;
            STACK_SHRINK(((oparg & 0x01) ? 1 : 0) + ((oparg & 0x02) ? 1 : 0) + ((oparg & 0x04) ? 1 : 0) + ((oparg & 0x08) ? 1 : 0));
