        TARGET(EXTENDED_ARG) {
            assert(oparg);
            assert(cframe.use_tracing == 0);
            opcode = next_instr->op.code;
            oparg = oparg << 8 | next_instr->op.arg;
            PRE_DISPATCH_GOTO();
            DISPATCH_GOTO();
        }

        TARGET(CACHE) {
            Py_UNREACHABLE();
        }
